const { createTheme } = require("@mui/material");
const { dark } = require("@mui/material/styles/createPalette");


export const darkTheme = createTheme(
    {
        palette: {
            mode: "dark",
            primary: {
                main: '#e91e63',
            },
            secondary: {
                main: '#5A20CB'
            },
            black: {
                main: '#242B2E'
            },
            background: {
                main: "#000000",
                default: '#0D0D0D'
            },
            textcolor: {
                main: '#FFFFFF'
            },
        }
    });
